import React from 'react';
import './App.css';
import { jumbotron } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <jumbotron>
        <h1>Tableau de Bord Admin</h1>
      </jumbotron>
    </div>
  );
}

export default App;
